/* 
1. Fetch data from API https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040
2. The result should be like this: https://www.thesportsdb.com/player/34162040
*/




import React from "react";


export default class JugadoresPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Jugador: []
        }

    }

    componentDidMount() {
        fetch("https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040")
            .then(response => response.json())
            .then(data => {
                this.setState({
                    Jugador: data
                })
            })
    }

    render() {
        return (
            <>
                {this.state.Jugador.map((jugador) => {
                    return (
                        <div className="row">
                            <div className="col-12">
                                <div className="card">
                                    <div className="card-body">
                                        <h5 className="card-title">{jugador.strPlayer}</h5>
                                        <h6 className="card-subtitle mb-2 text-muted">{jugador.strPosition}</h6>
                                        <p className="card-text">{jugador.strDescriptionEN}</p>
                                        <a href={jugador.strFacebook} className="card-link">Facebook</a>
                                        <a href={jugador.strTwitter} className="card-link">Twitter</a>
                                        <a href={jugador.strInstagram} className="card-link">Instagram</a>
                                    </div>
                                </div>
                            </div>
                        </div>
                    )
                })}
            </>
        )
    }
}
